.
Finalizo o ciclo de postagens dessa viagem especial em família, com uma cidade que ocupa um lugar mais que especial no meu coração.
. 
Poder revisitar o apartamento em que morei há alguns anos (uma das maiores experiências de aprendizado, cultura, pessoal e de vivência que tive) na minha querida Earls Court, junto aos meus pais e ao meu esposo, foi uma sensação maravilhosa e inesquecível.
.
Londres é uma das cidades mais cosmopolitas do mundo, na verdade aposto que seja a primeira. Uma mistura de povos, cultura, idiomas, entretenimento, pontos turísticos que encantam pela beleza e diversidade.
.
São inúmeras as opções de passeio nessa cidade de origem milenar, que abarca desde uma estrutura antiga mas preservada, até centros urbanos moderníssimos, servida pela estrutura fenomenal de seu sistema de metrô que é o mais antigo do mundo, bem como pelo aeroporto mais movimentado do mundo e atravessada pelo lindo Rio Tâmisa (Thames).
.
Impossível listar de uma vez todos os pontos turísticos, mas cito alguns que visitamos nessa oportunidade como o Palácio de Buckingham, Big Ben (que está passanso por uma looongaaa reforma), London Eye, Trafalgar Square, Tower Bridge, Piccadilly Circus, National Gallery, The British Museum.
.
Resumo da ópera: a Europa continua linda e apaixonante. Assim como minha amada London!
.
